import {Route, Routes} from "react-router-dom";
import Login from "./Login/Login";
import {Typography} from "@mui/material";
import MainPage from "./MainPage/MainPage";
import PersonalData from "./Data/PersonalData";
import UsersAdministration from "./Data/UsersAdministration";
import Initiatives from "./Initiative/Initiatives";
import InitiativeDetails from "./Initiative/InitiativeDetails";
import InitiativesAdministration from "./Initiative/InitiativesAdministration";
import CreateInitiativesForm from "./Initiative/CreateInitiativesForm";

const App =() => {
    return (
        <Routes>
            <Route path="/" element={<Login/>}/>
            <Route path="/home" element={<MainPage/>}/>
            <Route path='/myData' element={<PersonalData/>}/>
            <Route path='/usersAdministration' element={<UsersAdministration/>}/>
            <Route path={'/initiatives'} element={<Initiatives/>}/>
            <Route path={'/initiatives/:initiative'} element={<InitiativeDetails/>}/>
            <Route path={'/createInitiative'} element={<CreateInitiativesForm/>}/>
            <Route path={'/initiativesAdministration'} element={<InitiativesAdministration/>}/>
            <Route path={'/votations' } element={<Typography> votations </Typography>}/>
            <Route path='*' element={<Typography>Error 404: Page not found</Typography>}/>
        </Routes>
    )

}

export default App
